import React from 'react';
import JEFeatureCardHeader from './JEFeatureCardHeader';
import JEFeatureCardBody from './JEFeatureCardBody';

const NewOnline = Online.map(item => {
    return (<>
        <div className="col-md-4 col-12">
            <div className="card border-0">
                <img src={item.imgSrc} alt={item.title} className="card-img-top" />
                <div className="card-body text-center">
                    <h6><span className="display-6">{item.id}.</span> {item.title}</h6>
                    <p>{item.details}</p>
                </div>
            </div>
        </div>
    </>)
})

const NewOffline = Offline.map(item => {
    return (<>
        <div className="col-md-4 col-12">
            <div className="card border-0">
                <img src={item.imgSrc} alt={item.title} className="card-img-top" />
                <div className="card-body text-center">
                    <h6><span className="display-6">{item.id}.</span> {item.title}</h6>
                    <p>{item.details}</p>
                </div>
            </div>
        </div>
    </>)
})

const JExcFeatureSecCard = () => {
    return (<><div className="card border-0 shadow-lg rounded-lg">
        <JEFeatureCardHeader />
        <JEFeatureCardBody />
    </div></>);
}

export default JExcFeatureSecCard;
